import React, { Component } from "react";
import css from "./css/NavBarSimple.module.css";

class NavBarSimple extends Component {

  constructor(props) {
    super(props);

    this.state = {
      message: "Hello, guest!",
      buttonText: "Log in"
    }
  }

  // handleClick() = () => {

  // }

  render() {
    return (
      <div className={css.NavBar}>
        <h1>My Gallery</h1>
        <div>
          <span>{this.state.message}</span>
          <button></button>
        </div>
      </div>
    );
  }
}

export default NavBarSimple;
